V8:
Metro Xətainin yaxınlığında,16-mərtəbəli,tam yaşayışlı, yenitikili binanın 10-cu mərtəbəsində,2-otaqlı mənzil təcili satılır.
Ərazi haqqında:
-Metronun yaxınlığında yerləşir;
-Binanın yaxınlığında uşaq bağçasi
və məktəblər,market və başqa iaşə
obyektləri var;
-Ağ şəhərə gözəl panoramalı mənzərə.
Bina haqqında:
-daimi qaz,işıq və su təminatı;
-binanın su anbarı mövcuddur;
-binanın 1-mərtəbəli avto dayanacağı var;
-binanın həyəti həm canlı mühafizə,həm də təhlükəsizlik kameraları ilə izlənir.
Mənzil haqqında:
-kupça(çıxarış) var;
-mənzil təmirsizdir;
-mənzil orta blokda yerləşir;
-mənzil asanlıqla 3-otağa düzəldilə bilər.
Real müştəriyə endirim olunacaq.
Başqa variantlar da var.
